pragma solidity =0.7.6;

import './PositionNFT.sol';
import '../utils/Governed.sol';

/**
 * @title ZhuPositionNFT
 *
 * @notice All Debt positions are tokenized as an NFT. Zhu Position NFT is a standard ERC721 contract.
 */
contract ZhuPositionNFT is PositionNFT, Governed {
    constructor() PositionNFT('ZHU Tokenized Debt Position', 'ZHUDP') {}

    function _canMint(address minter) internal view override returns (bool) {
        return minter == address(governor.market());
    }

    function _canBurn(address) internal pure override returns (bool) {
        return false;
    }
}

