pragma solidity =0.7.6;

import '../interfaces/IPositionNFT.sol';

import '@openzeppelin/contracts/token/ERC721/ERC721.sol';

/**
 * @notice Simple interface for an NFT representing any tokenized position
 */
abstract contract PositionNFT is ERC721, IPositionNFT {

    constructor(string memory name, string memory symbol) ERC721(name, symbol) {}

    /// @notice The ID of the next NFT token that is minted.
    uint64 public override nextPositionID;

    /*****************************************************
     * ================ VIEW FUNCTIONS ================= *
     *****************************************************/
    /**
     * @notice Positions that the given account owns.
     *
     * @param account The account
     * @return IDs The positionIDs the given account owns.
     */
    function positionIDs(address account) external view override returns (uint64[] memory IDs) {
        uint balance =  balanceOf(account);
        IDs = new uint64[](balance);
        for(uint i = 0; i < balance; i++) IDs[i] = uint64(tokenOfOwnerByIndex(account, i));
    }

    /**
     * @notice Whether the given account is the owner or is approved to act on the owner's behalf
     * regarding the tokenID provided.
     *
     * @param account The account to check.
     * @param tokenID The tokenID to check.
     * @return Whether the account is approved or owner of tokenID.
     */
    function isApprovedOrOwner(address account, uint tokenID) external view override returns (bool) {
        return _isApprovedOrOwner(account, tokenID);
    }

    /*****************************************************
     * =============== SYSTEM FUNCTIONS ================ *
     *****************************************************/
    /**
     * @notice Authorized callers can call to mint `tokenID` and transfers it to `dest`.
     *
     * Requirements:
     * - Msg.sender must pass _canMint test specified in overriding contracts
     *
     * Emits a {Transfer} event.
     */
    function mintTo(address dest) external override returns (uint64 id) {
        require(_canMint(msg.sender), 'Not Authorized');
        require(nextPositionID < type(uint64).max, 'Overflow');

        id = nextPositionID;
        nextPositionID++;

        _mint(dest, id);

        return id;
    }

    /**
     * @notice Authorized callers can call to burn tokenID
     */
    function burn(uint64 tokenID) external override {
        require(_canBurn(msg.sender), 'Not Authorized');

        _burn(tokenID);
    }

    /// @dev Whether or not the given address has permission to mint tokens
    function _canMint(address) internal virtual view returns (bool);

    /// @dev Whether or not the given address has permission to burn tokens
    function _canBurn(address) internal virtual view returns (bool);
}

